import "./Table.css";

const Table = ({ products }) => {
  return (
    <table>
      <thead>
        <tr>
          <th>ID</th>
          <th>Category</th>
          <th>Name</th>
          <th>Quantity</th>
          <th>Price</th>
          <th>Actions</th>
        </tr>
      </thead>
      <tbody>
        {products.map((product) => (
          <tr key={product.ID}>
            <td>{product.ID}</td>
            <td>{product.Category}</td>
            <td>{product.Name}</td>
            <td>{product.Quantity}</td>
            <td>{product.Price.toFixed(2)} ₴</td>
            <td>
              <span onClick={() => handleEdit(product.ID)}>Pencil</span>
              <span onClick={() => handleDelete(product.ID)}>Trash</span>
            </td>
          </tr>
        ))}
      </tbody>
    </table>
  );
};

export default Table;
